import React from "react";

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg navbar-light mt-3">
      <div className="container-fluid px-4 mx-4">
        <button className="btn btn-secondary px-4" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">Doggo</button>
        <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
          <ul className="navbar-nav mb-2 mb-lg-0">
            <li className="nav-item">
              <button className="btn btn-secondary px-4 mx-2">List</button>
            </li>
            <li className="nav-item">
              <button className="btn btn-secondary px-4 mx-2">Track</button>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
